import  { formulario }  from './component/formulario'
import  { home }  from './component/home'
import { useState } from 'react';
import './App.css';

function App() {
  const [ user, setUser] = useState({})

  return (
    <div className="App">
      {
      !user.length > 0


   ? <formulario setUser={user} /> 
   : <home user={user}/>
   } 
   </div>
  );
}

export default App;
